window.bookSummaryJSON = "<p>Before #1 <i>New York Times</i> best-selling author Patricia Briggs created her two hugely successful urban fantasy series, Mercy Thompson and Alpha &amp; Omega, she wrote her debut fantasy epic, <i>Masques</i>. Newly revised and expanded, and available in audio for the first time, <i>Masques</i> arrives in our store just in time, with the fourth book in this series, <i>Wolfsbane</i>, coming soon.</p> <p>After an upbringing of proper behavior and oppressive expectations, Aralorn fled her noble birthright for a life of adventure as a mercenary spy. Her latest mission involves spying on the increasingly powerful sorcerer Geoffrey ae'Magi. But in a war against an enemy armed with the powers of illusion, how do you know who the true enemy is â€“ or where he will strike next?</p> <p>Katherine Kellgren (<i>Pride and Prejudice and Zombies</i>), one of Audible's favorite narrators and one of the premier voices of science fiction and fantasy, sweeps listeners away on this engrossing adventure.</p> <p><b>BONUS AUDIO: Includes an introduction written and read by author Patricia Briggs.</b></p>"; 
